import React from "react";

class ShowComments extends React.Component {

    render() {
        return this.props.data !== {} && this.props.data.map(item => (
            <div key={item}>
                <p>{item.name}</p>
                <p>{item.comment}</p>
                <p>{item.date}</p>
            </div>
        ))
    }
}

export default ShowComments;
